// ==UserScript==
// @name         USACO.org Dark Mode (By Friday_Night)
// @namespace    http://tampermonkey.net/
// @version      1.01
// @description  Dark mode for USACO - All pages + image + light blue links
// @author       Friday_night
// @match        https://usaco.org/*
// @grant        GM_addStyle
// @license MIT
// @downloadURL https://update.greasyfork.org/scripts/526910/USACOorg%20Dark%20Mode%20%28By%20Friday_Night%29.user.js
// @updateURL https://update.greasyfork.org/scripts/526910/USACOorg%20Dark%20Mode%20%28By%20Friday_Night%29.meta.js
// ==/UserScript==

(function() {
    'use strict';

    const darkModeCSS = `
        .panel,
        table, tr, td, th, pre, code,
        .sponsors, .sponsors img,
        div[style*="background-color"],
        *[style*="background-image"],
        #mainContent,
        #problemContent,
        .problem-text,
        #problem_content
         {
            background: #1c242c !important;
            color: #e0e0e0 !important;
            background-image: none !important;
        }

        /* ... (Rest of the CSS - include it all, EXCEPT the button and login styles) ... */

        .panel h2 { color: #a0c0ff !important; }

        /* Light blue links */
        a {
            color: #80b0ff !important; /* Light blue */
            text-decoration: none !important; /* Remove underlines */
        }

        a:visited {
            color: #a066ff !important; /* Purple visited links */
        }

        a:hover {
            color: #c0e0ff !important; /* Lighter blue on hover */
        }
        .navbar ul li a {
            color: #ffffff !important;
        }
        body
        {
            background: #121212 !important;
            color: #e0e0e0 !important;

        }
        .content
        {
            background: #111827 !important;
            color: #e0e0e0 !important;
        }
        .sponsors
        {
            width: 520px !important;
        }
    `;

    GM_addStyle(darkModeCSS);


    // Image replacement (example - you MUST verify the selector)
    const imageToReplace = document.querySelector("img[src*='usaco_logo.png']"); // Replace with the correct selector

        const newImage = document.createElement("img");
        newImage.src = "data:image/png;base64,";
        newImage.alt = imageToReplace.alt;
        newImage.style.width = imageToReplace.style.width;
        newImage.style.height = imageToReplace.style.height;

        imageToReplace.parentNode.replaceChild(newImage, imageToReplace);



})();